import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  { path: 'inicio', loadChildren: () => import('./inicio/inicio.module').then(m => m.InicioModule) },
  { path: 'post', loadChildren: () => import('./post/post.module').then(m => m.PostModule)},
  { path: 'comments', loadChildren: () => import('./inicio/inic.module').then(m => m.InicioModule) },
  { path: 'users', loadChildren: () => import('./inicio/inicio.module').then(m => m.InicioModule) },
  { path: 'todos',}, loadChildren: () => import('./inicio/inicio.module').then(m => m.InicioModule) },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
